import React from 'react';

function About() {
  return (
    <div>
      <h2>ℹ️ About</h2>
      <p>Inferno LLM Debugger & Visualizer<br/>Version 0.1.0<br/>Created by the Inferno team.</p>
    </div>
  );
}

export default About;
